class Solution {

    /**
     * @param String $s
     * @param String $p
     * @return Integer[]
     */
    function findAnagrams($s, $p) {
        $result = [];
        $pLength = strlen($p);
        $sLength = strlen($s);
        $pCount = array_fill(0, 26, 0);
        $sCount = array_fill(0, 26, 0);

        if ($pLength > $sLength) {
            return $result;
        }

        for ($i = 0; $i < $pLength; $i++) {
            $pCount[ord($p[$i]) - ord('a')]++;
            $sCount[ord($s[$i]) - ord('a')]++;
        }

        if ($pCount == $sCount) {
            $result[] = 0;
        }

        for ($i = $pLength; $i < $sLength; $i++) {
            $sCount[ord($s[$i]) - ord('a')]++;
            $sCount[ord($s[$i - $pLength]) - ord('a')]--;

            if ($pCount == $sCount) {
                $result[] = $i - $pLength + 1;
            }
        }

        return $result;
    }
}

