    function letterCombinations($digits) {
        if (empty($digits)) return [];

        $mapping = ["", "", "abc", "def", "ghi", "jkl", "mno", "pqrs", "tuv", "wxyz"];
        $result = [];
        $this->backtrack($result, "", $digits, 0, $mapping);
        return $result;
    }

    private function backtrack(&$result, $current, $digits, $index, $mapping) {
        if ($index == strlen($digits)) {
            $result[] = $current;
            return;
        }

        $digit = intval($digits[$index]);
        $letters = $mapping[$digit];
        for ($i = 0; $i < strlen($letters); $i++) {
            $this->backtrack($result, $current . $letters[$i], $digits, $index + 1, $mapping);
        }
    }
}

/**
 * @param {string} digits
 * @return {string[]}
 */
var letterCombinations = function(digits) {
    if (digits.length === 0) {
        return [];
    }

    const phoneMap = {
        '2': 'abc',
        '3': 'def',
        '4': 'ghi',
        '5': 'jkl',
        '6': 'mno',
        '7': 'pqrs',
        '8': 'tuv',
        '9': 'wxyz'
    };

    const result = [];

    const backtrack = (current, index) => {
        if (index === digits.length) {
            result.push(current);
            return;
        }

        const letters = phoneMap[digits[index]];
        for (const letter of letters) {
            backtrack(current + letter, index + 1);
        }
    };

    backtrack('', 0);
    return result;
};

class Solution {
    public List<String> letterCombinations(String digits) {
        if (digits.isEmpty()) return new ArrayList<>();

        String[] mapping = {"", "", "abc", "def", "ghi", "jkl", "mno", "pqrs", "tuv", "wxyz"};
        List<String> result = new ArrayList<>();
        backtrack(result, new StringBuilder(), digits, 0, mapping);
        return result;
    }

    private void backtrack(List<String> result, StringBuilder current, String digits, int index, String[] mapping) {
        if (index == digits.length()) {
            result.add(current.toString());
            return;
        }

        String letters = mapping[digits.charAt(index) - '0'];
        for (char c : letters.toCharArray()) {
            current.append(c);
            backtrack(result, current, digits, index + 1, mapping);
            current.deleteCharAt(current.length() - 1);
        }
    }
}

